import { Box } from "@mui/material";
import React from "react";
import { styled } from "@mui/material/styles";

const Container = styled(Box)`
    flex-grow: 1;
    flex-basic: 0;
    display: flex;
    flex-direction: column;
    padding: 0 8px 8px;
`

const Header = styled(Box)`
  display: flex;
  justify-content: space-between;
  background: #060606;
  color: #aaaebc;
  font-weight: 700;
`;

const Heading = styled(Box)`
  background: #1d1e22;
  padding: 9px 12px;
  display: flex;
`;

const Editor = ({heading, icon, color}) => {
  return (
    <Container>
      <Header>
        <Heading>
          <Box component="span" style={{
              background: color,
              height: 20,
              width: 20,
              color: '#000',
              display: 'flex',
              placeContent: 'center'
          }}>
              {icon}
          </Box>
          {heading}
        </Heading>
      </Header>
    </Container>
  );
};

export default Editor;
